/** @format */

import React from "react";
import styled from "styled-components";
import HomeIcon from "@mui/icons-material/Home";
import AnalyticsIcon from "@mui/icons-material/Analytics";
import TrendingUpIcon from "@mui/icons-material/TrendingUp";

const Sidebar = () => {
	return (
		<Container>
			<Wrapper>
				<SidebarMenu>
					<SidebarMenuTile>Dashboard</SidebarMenuTile>
					<SidebarMenuList>
						<SidebarMenuListItem>
							<HomeIcon />
							HOME
						</SidebarMenuListItem>
						<SidebarMenuListItem>
							<AnalyticsIcon />
							ANALYTICS
						</SidebarMenuListItem>
						<SidebarMenuListItem>
							<TrendingUpIcon />
							SALES
						</SidebarMenuListItem>
					</SidebarMenuList>
				</SidebarMenu>
				<SidebarMenu>
					<SidebarMenuTile>Quick Menu</SidebarMenuTile>
					<SidebarMenuList>
						<SidebarMenuListItem>
							<HomeIcon />
							USERS
						</SidebarMenuListItem>
						<SidebarMenuListItem>
							<AnalyticsIcon />
							ANALYTICS
						</SidebarMenuListItem>
						<SidebarMenuListItem>
							<TrendingUpIcon />
							SALES
						</SidebarMenuListItem>
					</SidebarMenuList>
				</SidebarMenu>
			</Wrapper>
		</Container>
	);
};

export default Sidebar;

const Container = styled.div`
	flex: 1;
	border-right: 1px solid lightgray;
	height: calc(100vh - 60px);
	position: sticky;
	top: 60px;
`;
const Wrapper = styled.div`
	padding: 10px;
`;
const SidebarMenu = styled.div`
	margin-bottom: 20px;
`;
const SidebarMenuTile = styled.h1`
	font-size: 18px;
	color: gray;
	font-weight: 300;
	letter-spacing: 2px;
`;
const SidebarMenuList = styled.ul`
	list-style: none;
	margin-top: 10px;
`;
const SidebarMenuListItem = styled.li`
	display: flex;
	align-items: center;
	margin: 10px 0px;
	gap: 5px;
	cursor: pointer;
	border-radius: 5px;
	padding: 5px;
	&:hover {
		background-color: #f6e5e5;
	}
`;
